import React, { Component } from 'react';
import './App.css';

class Subject extends Component {
  render() { //컴퍼넌트는 반드시 하나의 최상위 태그로 시작해야함 
    return (
      <header>
        <h1>WEB</h1>
        welcome!
    </header>
    );
  }
}
class Link extends Component{
  render(){
    return (
      <a herf={this.props.filename}>{this.props.title}</a>
    );
  }
}
class TOC extends Component{
  render(){
    return (
      <nav>
        <ul>
            <li><Link title="HTML" filename="1.html"></Link></li>
            <li><Link title="JS" filename="2.html"></Link></li>
            <li><Link title="CSS" filename="3.html"></Link></li>
        </ul>
        </nav>
    );
  }
}
class App extends Component {
  render() {
    return (
      <div className="App">
        <Subject></Subject>
        <TOC></TOC>
      </div>
    );
  }
}
class HTML extends Component {

}
export default App;
